import { CLOUDSTART } from "./Cloud.js";
import { NOVA } from "./CloudStart.js";

export const CLOUDCONNECTION=(PATH)=>{

    if (localStorage.getItem("Environment") === "Development" ) {

        fetch(PATH)
        .then(res =>res.text())
        .then(data =>{

            localStorage.setItem('PROJECT',data);

            NOVA();

            CLOUDSTART();

        })
        .catch(error=>{console.log(error)}
        );
        
    } else {

        const DATA={
            "spreadsheetUrl":"https://docs.google.com/spreadsheets/d/1Utfr1wkoZSRvM9TOKaTxOX6orYE8AuN2mu4dDtQmhFQ/edit?usp=sharing",
            "sheetName":"APPMANAGER"    
        };

        const APIS="https://script.google.com/macros/s/AKfycbyHFabMyQk2EoZXk8VV-L4dBKPAe6knmhyAm1W6sQ9_WRmq5clAozbfIznoCHY0l1ssSQ/exec";

        fetch(APIS,{
            method:"POST",
            mode:"cors",
            body:JSON.stringify(DATA)
        })

        .then(res => res.json())

        .then(data =>{

            data.forEach(element => {
                
                if(localStorage.getItem("NAME") !== element.ID){

                    document.querySelector("body").innerHTML=`

                        <div style="display: inline-flex; height: 200px; margin: 5%;">
                            
                            <img style="width: 50%; margin: auto;" src="data:image/png;base64,">
                        
                        </div>

                        <h1 style="color: red; text-align: center; margin-top: 10%; font-size: 50px; ">Error</h1>
                        
                        <p style="color: #cdcdcd; text-align: left; font-size: 20px; margin: 5%; ">Something Went Wrong ,<br>Please Clear App Cache Data and Try Again</p>
                        
                        <button class="Retry" style="width: 95%; margin: 2.5%; background: forestgreen; color: white; height: 50px; border-radius: 10px; border: none;">Retry</button>
                        
                    `;

                    return;
                    
                };

                if (localStorage.getItem("NAME") === element.ID ) {

                    console.log(element);

                    return;
                    
                };
                
            });

        })
        .catch(Error => console.log(Error)
        )
        
    }

};